import React, {Component} from 'react';



class Searcher extends Component {
    render() {
        return this.props.datas.map((data) => (

            <table>
                <tr>
                    <td>{ data.Departure_data}</td>
                    <td>{ data.price}</td>
                </tr>
            </table>

        ))
    }
}

export default Searcher;
